import { profile } from 'console';
import React from 'react'
import { IProfile } from '../Models/IProfile';
import './style.css'

interface IProps{
   profile:IProfile 
}
interface IState{

}
class GithubProfileCard extends  React.Component<IProps,IState>
{
    constructor(props:IProps)
    {
        super(props)
    }
    render(){
        let {profile}=this.props;
        return(
            <React.Fragment>
        <section>
                    <div className='row'>
                <div className='col'>
                <div className='card-header bg-primary text-white'>
                    <h2 className='mt-5'>Profile</h2>
                    </div>
                    <div className='card-body'>
                        <div className='row'>
                            <div className='col-md-6'>

                <img src={profile.avatar_url } alt='' className='img-fluid rounded-circle '/>
                <h3 className='mt-3 text-danger'>{profile.login}</h3>
                    <h3 className='text-center text-secondary'>{profile.name}</h3>
                    <p className='h6'>Profile id:{profile.id}</p>
                   bio: <small className='text-secondary'>{profile.bio} </small><br/>
                   Location:<h5>{profile.location}</h5>
                   Email:<h5>{profile.email}</h5>
                   <br/>
                   </div>
<div ></div>
<a className="btn btn-dark text-white btn-md" href={profile.html_url}role="button">html</a>
                <span><a className="btn btn-dark text-white btn-md" href={profile.followers_url}role="button">followers</a></span>
                <span><a className="btn btn-dark text-white btn-md" href={profile.following_url}role="button">following</a></span>
                </div>
                </div>
                </div>
   </div>
                
                </section>
            </React.Fragment>
        )
    }
};
export default GithubProfileCard;
